import { useState } from 'react';
import { Stack, Button, Dialog, DialogTitle, DialogContent, IconButton, Box } from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';

interface PortfolioItem {
  title: string;
  description: string;
  filePath: string;
}

const portfolioItems: PortfolioItem[] = [
  {
    title: 'Databricks vs Starburst',
    description: 'Comp intel for DBX',
    filePath: '/htmls/DBX.html'
  },
  {
    title: 'Dremio vs Starburst',
    description: 'Dremio Comp Intel',
    filePath: '/htmls/DRE.html'
  },
  {
    title: 'Snowflake vs Starburst',
    description: 'snowflake Comp Intel',
    filePath: '/htmls/SNOW.html'
  },
  {
    title: 'Membership Growth & Certifications (Consulting Project)',
    description: 'Consulting project',
    filePath: '/PDF/MOPS.pdf'
  }
];

function Portfolio() {
  const [selectedItem, setSelectedItem] = useState<PortfolioItem | null>(null);

  const handleOpenDialog = (item: PortfolioItem) => {
    setSelectedItem(item);
  };

  const handleCloseDialog = () => {
    setSelectedItem(null);
  };

  return (
    <div>
      <h1>Portfolio Samples</h1>
      <Stack direction="column" spacing={2}>
        {/* 3. Dynamically create a button for each item in the array */}
        {portfolioItems.map((item) => (
          <Button
            key={item.title}
            variant="contained"
            onClick={() => handleOpenDialog(item)}
          >
            {item.title}
          </Button>
        ))}
      </Stack>

      {/* 4. The Dialog now gets its content dynamically from the state */}
      <Dialog
        onClose={handleCloseDialog}
        open={!!selectedItem} // The !! converts the object/null to a boolean (true/false)
        fullWidth={true}
        maxWidth="md"
      >
        <DialogTitle>
          {selectedItem?.title}{/* Use optional chaining in case state is null */}
          <IconButton
            aria-label="close"
            onClick={handleCloseDialog}
            sx={{ position: 'absolute', right: 8, top: 8 }}
          >
            <CloseIcon />
          </IconButton>
        </DialogTitle>
        <DialogContent dividers>
          {selectedItem && ( // Only render the iframe if an item is selected
            <iframe
              src={selectedItem.filePath}
              title={selectedItem.title}
              width="100%"
              height="500px"
              style={{ border: 'none' }}
            />
          )}
        </DialogContent>
      </Dialog>
    </div>
  );
}

export default Portfolio;
